import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';
import { Route, Routes } from 'react-router-dom';



function App() {
  return (
    <div>
      <Navbar />
      <Routes>
        <Route path="/home" exact>
          <Home />
        </ Route>
        <Route path="/about" componet={About} />
      </Routes>
    </div>
  );
}

export default App;
